Step-by-step reasoning:
• Key psychological mechanisms: Responders care about both the monetary gain (split_self) and how “fair” the offer is relative to their proportional contribution (determined by token_self relative to total tokens). Deviations from a fairness benchmark (F) incur a penalty.
• Interaction of mechanisms: The fairness benchmark is computed as F = (token_self / (token_self + token_opp)) × combined_earning. The discrepancy between the actual offer (split_self) and F is measured on a normalized scale. The greater the normalized deviation, the larger the penalty to the basic monetary utility.
• Mathematical form: We first compute a normalized deviation d = (split_self / F) − 1. Then we assume that the penalty grows nonlinearly with the size of |d|. To capture individual differences in sensitivity to this normalized fairness discrepancy, the penalty is multiplied by a scaling parameter (kappa) raised to an exponent (psi) that captures non-linear sensitivity.
• Needed parameters: Two learnable parameters will calibrate the model. The first, kappa, scales the magnitude of the fairness penalty. The second, psi, adjusts the nonlinearity of the penalty with respect to the normalized deviation.
• Mapping to observable behavior: split_self, token_self, token_opp, and combined_earning are directly observed. The derived fair share F is used to compare with the actual monetary split (split_self). The resulting utility U_accept of accepting the offer is given by the offered share diminished by the penalty incurred for deviating from fairness. Negative utilities indicate an offer unlikely to be accepted.

Below is the formal model specification.

<MODEL>
Let F = (token_self / (token_self + token_opp)) × combined_earning
Let d = (split_self / F) − 1
U_accept = split_self × (1 − kappa × |d|^(psi))
</MODEL>

